tables.table_schema:
CREATE TABLE stress_data (
    id INT PRIMARY KEY,
    user_id INT,
    stress_level INT,
    timestamp TIMESTAMP
);

CREATE TABLE users (
    id INT PRIMARY KEY,
    name VARCHAR(50),
    age INT,
    gender VARCHAR(10)
);

CREATE TABLE stress_data (
    user_id INT,
    stress_level INT,
    stress_timestamp TIMESTAMP,
    FOREIGN KEY (user_id) REFERENCES users(id)
);

CREATE TABLE Device (
    device_id SERIAL PRIMARY KEY,
    device_name VARCHAR(50),
    user_id INT,
    FOREIGN KEY (user_id) REFERENCES User(user_id)
);

CREATE TABLE Device_Info (
    device_id INT PRIMARY KEY,
    device_type VARCHAR(20),
    manufacturer VARCHAR(50),
    purchase_date DATE
);
